-- Terms And Conditions for ACH

UPDATE `termandconditiontext` SET `Content` = '<b class=\"\">Service<o :P class=\"\"></o:p></b>&nbsp;<div>&nbsp;\n<br>Bank provides automated clearing\nhouse (ACH) origination services that will enable Customer to do one or more\nof the following: originate ACH Debit Entries; originate ACH Credit Entries;\nand instruct the Bank to issue or transmit prenotifications, reversals,\nrequests for return, notifications of change or other information pertaining to\nthe Entries.&nbsp;</div><div><o :P class=\"\"></o:p>\n\n<br>Origination of ACH Credit Entries\nand origination of ACH Debit Entries are two separate services and approval or\nset up for one ACH service does not automatically create the ability to utilize\nthe other. The Rules and these Service Terms shall apply to all Entries,\nwhether or not transmitted through an ACH Operator. It is Customers\nresponsibility to provide Entries and instructions to Bank with all the necessary\ninformation to complete Customers requested transactions.&nbsp;</div><div><o :P class=\"\"></o:p>\n\n<br>Customer agrees to transmit\nEntries to Bank in the manner, at the times and in accordance with approved\nmedia, content and format as agreed by Bank and Customer. Bank may reject or\ndelay processing transactions or information if instructions are not complete\nor are inaccurate, contain an inactive Company ID or otherwise do not meet the\ncriteria Bank specifies for acceptance.&nbsp;</div><div><o :P class=\"\"></o:p>\n\n<br>All requests to Bank must be\nreceived by Bank before Banks established cut-off time in order for processing\nto commence on that ACH processing day. Any request that is incomplete or that\nBank finishes receiving after the relevant cut-off time will be processed by\nBank on the next day Bank processes ACH transactions. All transactions are\nsubject to acceptance by Bank. Bank will notify Customer of any transactions or\nother transmissions that are rejected or returned. If Customer wants Bank to\nre-process those transactions or transmissions, Customer must correct them and\nre-submit them.&nbsp;</div><div><o :P class=\"\"></o:p>\n\n<br>Customer agrees to furnish Bank\nwith copies of any authorizations or notifications, if requested, as well as\nany other information reasonably requested by Bank relating to Entries\noriginated by the Customer. Customer shall provide Banks auditors and other\npersonnel with reasonable access at all reasonable times to the Customers\nfacilities, data and records relating to the initiation of Entries for the\npurpose of auditing Customers compliance with these Service Terms and the\nRules.&nbsp;</div><div><o :P class=\"\"></o:p>\n\n<br><b class=\"\">Security and Data Protection Procedures.&nbsp;</b></div><div><b class=\"\"><o :P class=\"\"></o:p></b>\n\n<b><br></b>All instructions received by Bank\nin Customers name are subject to verification pursuant to mutually agreed\nsecurity procedures. If Bank follows those procedures, Bank may process and\ntransmit transactions or information in Customers name.&nbsp;<o :P class=\"\"></o:p></div>' WHERE (`id` = '3450022'); 

